package com.vrv.cems.service.cache.bean;

public class UserOnlineBean {
	/**
	 * 用户唯一ID
	 */
	private String userOnlyId;
	/**
	 * 用户账号
	 */
	private String account;
	/**
	 * 设备唯一ID
	 */
	private String devOnlyId;
	/**
	 * 最后登录时间
	 */
	private String loginTime;
	/**
	 * 登录操作系统的帐号
	 */
	private String loginAccount;
	public UserOnlineBean() {
		super();
	}
	public UserOnlineBean(String userOnlyId, String account, String devOnlyId,
			String loginTime, String loginAccount) {
		super();
		this.userOnlyId = userOnlyId;
		this.account = account;
		this.devOnlyId = devOnlyId;
		this.loginTime = loginTime;
		this.loginAccount = loginAccount;
	}
	public String getUserOnlyId() {
		return userOnlyId;
	}
	public void setUserOnlyId(String userOnlyId) {
		this.userOnlyId = userOnlyId;
	}
	public String getAccount() {
		return account;
	}
	public void setAccount(String account) {
		this.account = account;
	}
	public String getDevOnlyId() {
		return devOnlyId;
	}
	public void setDevOnlyId(String devOnlyId) {
		this.devOnlyId = devOnlyId;
	}
	public String getLoginTime() {
		return loginTime;
	}
	public void setLoginTime(String loginTime) {
		this.loginTime = loginTime;
	}
	public String getLoginAccount() {
		return loginAccount;
	}
	public void setLoginAccount(String loginAccount) {
		this.loginAccount = loginAccount;
	}
	
	
}
